import React, { Component } from 'react'

import {Route} from 'react-router-dom'
export default class Sidebar extends Component {
    render() {
        return (
            <div class="sidenav">
                <Link to="/About"></Link>
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Clients</a>
                <a href="#">Contact</a>
            </div>
        )
    }
}
